// Texture image block count
const size_t CVF_FIXED_ATLAS_FONT_LARGE_TEXTURE_IMAGE_BLOCK_COUNT = 588;



//==================================================================================================
///
/// \class cvf::FixedAtlasFont
/// \ingroup Render
///
/// Loads a given fixed atlas font to be used when drawing text
//==================================================================================================

//--------------------------------------------------------------------------------------------------
/// 
//--------------------------------------------------------------------------------------------------
FixedAtlasFont::FixedAtlasFont(FontSize size)
:   m_name(""),
    m_numGlyphs(0),
    m_textureImage(NULL)
{
    bool fontLoaded = false;

    switch (size)
    {
        case FixedAtlasFont::STANDARD:
        {
            fontLoaded = load(
                CVF_FIXED_ATLAS_FONT_STANDARD_NAME, 
                CVF_FIXED_ATLAS_FONT_STANDARD_NUM_GLYPHS,
                CVF_FIXED_ATLAS_FONT_STANDARD_HORIZONTAL_BEARINGS_X,
                CVF_FIXED_ATLAS_FONT_STANDARD_HORIZONTAL_BEARINGS_Y,
                CVF_FIXED_ATLAS_FONT_STANDARD_HORIZONTAL_ADVANCES,
                CVF_FIXED_ATLAS_FONT_STANDARD_CHARACTER_WIDTHS,
                CVF_FIXED_ATLAS_FONT_STANDARD_CHARACTER_HEIGHTS,
                CVF_FIXED_ATLAS_FONT_STANDARD_TEXTURE_IMAGE_WIDTH,
                CVF_FIXED_ATLAS_FONT_STANDARD_TEXTURE_IMAGE_HEIGHT,
                CVF_FIXED_ATLAS_FONT_STANDARD_TEXTURE_IMAGE_BLOCK_COUNT,
                CVF_FIXED_ATLAS_FONT_STANDARD_TEXTURE_IMAGE);

            break;
        }

        case FixedAtlasFont::LARGE:
        {
            fontLoaded = load(
                CVF_FIXED_ATLAS_FONT_LARGE_NAME, 
                CVF_FIXED_ATLAS_FONT_LARGE_NUM_GLYPHS,
                CVF_FIXED_ATLAS_FONT_LARGE_HORIZONTAL_BEARINGS_X,
                CVF_FIXED_ATLAS_FONT_LARGE_HORIZONTAL_BEARINGS_Y,
                CVF_FIXED_ATLAS_FONT_LARGE_HORIZONTAL_ADVANCES,
                CVF_FIXED_ATLAS_FONT_LARGE_CHARACTER_WIDTHS,
                CVF_FIXED_ATLAS_FONT_LARGE_CHARACTER_HEIGHTS,
                CVF_FIXED_ATLAS_FONT_LARGE_TEXTURE_IMAGE_WIDTH,
                CVF_FIXED_ATLAS_FONT_LARGE_TEXTURE_IMAGE_HEIGHT,
                CVF_FIXED_ATLAS_FONT_LARGE_TEXTURE_IMAGE_BLOCK_COUNT,
                CVF_FIXED_ATLAS_FONT_LARGE_TEXTURE_IMAGE);

            break;
        }

        default:
        {
            CVF_FAIL_MSG("Fixed Atlas Font size not supported");
        }
    }

    // Make sure isEmpty fails if unable to load
    if (!fontLoaded)
    {
        m_textureImage = NULL;
    }
}


//--------------------------------------------------------------------------------------------------
/// 
//--------------------------------------------------------------------------------------------------
FixedAtlasFont::~FixedAtlasFont()
{
}


//--------------------------------------------------------------------------------------------------
/// Get name of the font
//--------------------------------------------------------------------------------------------------
const String& FixedAtlasFont::name() const
{
    return m_name;
}


//--------------------------------------------------------------------------------------------------
/// Get glyph for the given character. Will be created if not already present.
//--------------------------------------------------------------------------------------------------
ref<Glyph> FixedAtlasFont::getGlyph(wchar_t character)
{
    if (isEmpty()) return NULL;

    uint characterPos = static_cast<uint>(character) > static_cast<uint>(m_numGlyphs) ? 0 : static_cast<uint>(character);

    ref<Glyph> glyph = NULL;

    // Glyph already available?
    MapType::iterator it = m_atlasMap.find(characterPos);
    if (it != m_atlasMap.end())
    {
        // Yes, return existing glyph
        glyph = it->second;
    }
    else
    {
        glyph = new Glyph(character);
        glyph->setHorizontalBearingX(m_horizontalBearingsX[characterPos]);
        glyph->setHorizontalBearingY(m_horizontalBearingsY[characterPos]);
        glyph->setHorizontalAdvance(m_horizontalAdvances[characterPos]);

        // Todo: Work directly on the common atlas texture with texture coordinates
        //glyph->m_textureImage = m_textureImage;

        // Size of the image texture. Note that there may be some 'air' around this.
        uint textureWidth = m_characterWidths[characterPos];
        uint textureHeight = m_characterHeights[characterPos];

        // Start position in textureImage atlas
        uint cursorX = (m_textureImage->width() / static_cast<uint>(m_numGlyphs)) * characterPos;

        TextureImage* glyphTextureImage = new TextureImage;
        glyphTextureImage->allocate(textureWidth, textureHeight);
        uint x, y;
        for (y = 0; y < textureHeight; y++)
        {
            for (x = 0; x < textureWidth; x++)
            {
                glyphTextureImage->setPixel(x, y, m_textureImage->pixel(cursorX + x, y));
            }
        }
        glyph->setTextureImage(glyphTextureImage);

        glyph->setWidth(glyphTextureImage->width());
        glyph->setHeight(glyphTextureImage->height());

        m_atlasMap.insert(MapType::value_type(characterPos, glyph));
    }

    CVF_TIGHT_ASSERT(glyph.notNull());
    return glyph;
}


//--------------------------------------------------------------------------------------------------
/// Get advance for character glyph in relation to the next character
//--------------------------------------------------------------------------------------------------
uint FixedAtlasFont::advance(wchar_t character, wchar_t nextCharacter)
{
    CVF_UNUSED(nextCharacter);  // No kerning available

    ref<Glyph> characterGlyph = getGlyph(character);

    uint characterWidth = characterGlyph->horizontalBearingX() + characterGlyph->width();

    return characterWidth > characterGlyph->horizontalAdvance() ? characterWidth : characterGlyph->horizontalAdvance();
}


//--------------------------------------------------------------------------------------------------
/// Returns true if the font is set up properly and ready to be used, otherwise returns false.
//--------------------------------------------------------------------------------------------------
bool FixedAtlasFont::isEmpty()
{
    return m_textureImage.isNull();
}


//--------------------------------------------------------------------------------------------------
/// Load a pre-rendered fixed atlas font directly form data arrays. 
///
/// This kind of data has typically been exported by "FreeType Font Extractor" 
/// Copyright (c) Ceetron AS
//--------------------------------------------------------------------------------------------------
bool FixedAtlasFont::load(const char* name, size_t numGlyphs, 
    const short* horizontalBearingsX, const short* horizontalBearingsY,
    const uint* horizontalAdvances, const uint* characterWidths, const uint* characterHeights,
    const size_t textureImageWidth, const size_t textureImageHeight,
    const size_t numTextureImageDataBlockCount, const char** textureImageData)
{
    CVF_ASSERT(name);
    CVF_ASSERT(numGlyphs > 0);
    CVF_ASSERT(horizontalBearingsX);
    CVF_ASSERT(horizontalBearingsY);
    CVF_ASSERT(horizontalAdvances);
    CVF_ASSERT(characterWidths);
    CVF_ASSERT(characterHeights);
    CVF_ASSERT(textureImageWidth > 0);
    CVF_ASSERT(textureImageHeight > 0);
    CVF_ASSERT(numTextureImageDataBlockCount > 0);
    CVF_ASSERT(textureImageData);

    unload();
    CVF_ASSERT(m_textureImage.isNull());

    size_t i;
    
    // Calculate size of buffer to be preallocated
    size_t textureImageDataBufferSize = 0;
    for (i = 0; i < numTextureImageDataBlockCount; i++)
    {
        textureImageDataBufferSize += strlen(textureImageData[i]);
    }

    // Create and populate buffer to be decoded
    std::string encodedTextureImageData;
    encodedTextureImageData.reserve(textureImageDataBufferSize);
    for (i = 0; i < numTextureImageDataBlockCount; i++)
    {
        encodedTextureImageData += textureImageData[i];
    }

     // Decode texture image data containing the glyph images
    ref<UByteArray> decodedTextureImageData = Base64::decode(encodedTextureImageData);
    if (decodedTextureImageData.isNull()) return false;
    if (decodedTextureImageData->size() == 0) return false;

    m_name = name;
    if (m_name.isEmpty()) return false;

    m_numGlyphs = numGlyphs;

    m_horizontalBearingsX.resize(numGlyphs);
    for (i = 0; i < numGlyphs; i++)
    {
        m_horizontalBearingsX[i] = horizontalBearingsX[i];
    }

    m_horizontalBearingsY.resize(numGlyphs);
    for (i = 0; i < numGlyphs; i++)
    {
        m_horizontalBearingsY[i] = horizontalBearingsY[i];
    }

    m_horizontalAdvances.resize(numGlyphs);
    for (i = 0; i < numGlyphs; i++)
    {
        m_horizontalAdvances[i] = horizontalAdvances[i];
    }

    m_characterWidths.resize(numGlyphs);
    for (i = 0; i < numGlyphs; i++)
    {
        m_characterWidths[i] = characterWidths[i];
    }

    m_characterHeights.resize(numGlyphs);
    for (i = 0; i < numGlyphs; i++)
    {
        m_characterHeights[i] = characterHeights[i];
    }

    m_textureImage = new TextureImage;
    m_textureImage->allocate(static_cast<uint>(textureImageWidth), static_cast<uint>(textureImageHeight));
    m_textureImage->setData(decodedTextureImageData->ptr(), static_cast<uint>(textureImageWidth), static_cast<uint>(textureImageHeight));

    return true;
}


//--------------------------------------------------------------------------------------------------
/// 
//--------------------------------------------------------------------------------------------------
void FixedAtlasFont::unload()
{
    m_name = "";
    m_numGlyphs = 0;
    m_horizontalBearingsX.clear();
    m_horizontalBearingsY.clear();
    m_horizontalAdvances.clear();
    m_characterWidths.clear();
    m_characterHeights.clear();
    m_textureImage = NULL;
}

